import { useState } from "react";
const Content = () => {
    const[name , setName] = useState('Tanu');
    const handleName = () => {
        const names = ['Tanishka','Tanu','Tanya'];
        const num = Math.floor(Math.random()*3);
        setName(names[num]);
      }
    return(
        <main>
            <p>
                Hello {handleName()}!
            </p>
            <button>Change name</button>
        </main>
    )
};

export default Content;
